import React, {Component} from 'react';
import {Col, Container, Row} from "react-bootstrap";

class Volunteers extends Component {
    render() {
        return (
            <div className={'Volunteers'}>
                <h1>Волонтеры</h1>
                <h3>Помощь оказывается бесплатно</h3>
                <Container>
                    <Row>
                        <Col md={6}>
                            Content
                        </Col>
                        <Col md={6}>
                            Info
                        </Col>
                    </Row>
                </Container>
            </div>
        );
    }
}

export default Volunteers;
